      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN + col1 AND + CAST ( NULL AS INTEGER ) + + col1 + col0;
  - name: tab2

outputs:
  - name: q3210.out
    data: |
